var introductorySlides=function(){"use strict";var a=$(".introductory-slides");var b=$(".introductory-slides-pause");var c=$(".introductory-slides-play");var d=$(".introductory-slides-prev");var e=$(".introductory-slides-next");a.carousel({interval:1e4,ride:"carousel",pause:""});b.on("click",function(){a.carousel("pause")});c.on("click",function(){a.carousel("next");a.carousel("cycle")});d.on("click",function(){a.carousel("pause");a.carousel("prev")});e.on("click",function(){a.carousel("pause");a.carousel("next")})}();var navigationScroll=function(){"use strict";$('a[href^="#"]').click(function(){$.scrollTo($(this).attr("href"),800,{offset:-89})})}();var pricingTableTerms=function(){"use strict";var a=$('[name="sponsorship-term"]:checked').val();$("[data-item-payment-interval-count]").addClass("d-none");$('[data-item-payment-interval-count="'+a+'"]').removeClass("d-none");$('[name="sponsorship-term"]').change(function(){$("[data-item-payment-interval-count]").addClass("d-none");$('[data-item-payment-interval-count="'+this.value+'"]').removeClass("d-none");console.log(this.value)})}();